<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml"
      xmlns:wicket="http://wicket.apache.org">
<head>
    <meta charset="utf-8"/>
</head>
<body>
<wicket:panel>
    <tr class="navigation">
        <td wicket:id="span">
            <div class="navigatorLabel">
                <span wicket:id="navigatorLabel"></span>
            </div>
            <div class="navigator">
                <span wicket:id="navigator"></span>
            </div>
            <div class="navigatorFormPanel">
                <span wicket:id="navigatorFormPanel"></span>
            </div>
        </td>
    </tr>
</wicket:panel>
</body>
</html>
